(function() {
  angular.module('ControlPanel').factory('adsService', [
    '$http', function($http) {
      var adsService;
      adsService = {
        data: {
          ads: [
            {
              "id": 0,
              "name": "Loading ..."
            }
          ]
        },
        isLoaded: false
      };
      adsService.loadAds = function(deferred) {
        if (!adsService.isLoaded) {
          return $http.get('./ads.json').success(function(data) {
            adsService.data.playlists = data;
            adsService.isLoaded = true;
            console.log('Successfully loaded ads.');
            if (deferred) {
              return deferred.resolve();
            }
          }).error(function() {
            console.error('Failed to load ads.');
            if (deferred) {
              return deferred.resolve();
            }
          });
        } else {
          if (deferred) {
            return deferred.resolve();
          }
        }
      };
      adsService.deleteAd = function(adId) {
        console.log('Ad with id ' + adId + ' is going to get deleted');
        return $http["delete"]('./ads/' + adId + '.json').success(function() {
          return console.log('Deleted success!');
        }).error(function() {
          return console.log('Delete failed');
        });
      };
      adsService.createAd = function(newAd) {
        var data;
        data = {
          new_ad: {
            name: newAd.newAdName
          }
        };
        $http.post('./ads.json', data).success(function(data) {
          console.log('Succesfully created ad.');
          return adsService.data.ads.push(data);
        }).error(function() {
          return console.error('Failed to create new ad');
        });
        return true;
      };
      return adsService;
    }
  ]);

}).call(this);
