(function() {
  this.DashboardCtrl = function($scope, usersService, $q, $upload, $filter) {
    $scope.title = "Digital Ad Control Panel";
    $scope.currentUser = usersService.data.currentUser;
    $scope.bars = [];
    $scope.prepCurrentUser = function() {
      return $scope.currentUser = usersService.data.currentUser;
    };
    this.deferred = $q.defer();
    this.deferred.promise.then($scope.prepCurrentUser);
    usersService.loadCurrentUser(this.deferred);
    return $scope.onFileSelect = function($files) {
      var busy, file, i, myBar;
      i = 0;
      while (i < $files.length) {
        file = $files[i];
        busy = false;
        myBar = {};
        myBar.name = file.name;
        myBar.value = 0;
        $scope.bars.push(myBar);
        $scope.upload = $upload.upload({
          url: "fileuploads",
          file: file,
          fileFormDataName: 'dbfile'
        }).progress(function(evt) {
          console.log(file.name + " returned ");
          myBar.value = parseInt(100.0 * evt.loaded / evt.total);
        }).success(function(data, status, headers, config) {});
        i++;
      }
    };
  };

  this.DashboardCtrl.$inject = ['$scope', 'usersService', '$q', '$upload', '$filter'];

}).call(this);
